//import './ItemList.css';

import {
  IonButton,
  IonCard,
  IonCardContent,
  IonCardHeader,
  IonCardSubtitle,
  IonCardTitle,
  IonItem,
  IonLabel,
  IonThumbnail,
} from "@ionic/react";

interface ContainerProps {
  name: string;
}

const ItemList: React.FC<ContainerProps> = ({ name }) => {
  return (
    <>
      <IonItem>
        <IonThumbnail slot="start">
          <img alt="Silhouette of mountains" src="https://ionicframework.com/docs/img/demos/thumbnail.svg" />
        </IonThumbnail>
        <IonCardHeader>
          <IonCardTitle>Card Title</IonCardTitle>
          <IonCardSubtitle>Card Subtitle</IonCardSubtitle>
        </IonCardHeader>
        <IonButton slot="end" shape="round" fill="outline">
          &gt;
        </IonButton>
      </IonItem>
    </>
  );
};

export default ItemList;
